import * as React from 'react'

function Addcomment(props) {
    return (
        <svg width="2em" height="2em" viewBox="0 0 23 23" fill="none" {...props}>
            <path d="M12 8V14M15 11H9M12.2896 17.9984C18.0965 17.9343 21 15.9189 21 11C21 6 18 4 12 4C6 4 3 6 3 11C3 14.0771 4.13623 16.018 6.40868 17.0557L5 21L12.2896 17.9984Z" stroke="#1c05b3" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"></path>
        </svg>
    )
}

export default Addcomment
